export class Vector2D{constructor(t,r){this.x=t??0,this.y=r??0}toString(t){t=t||3;let r=Math.pow(10,t);return"["+Math.round(this.x*r)/r+", "+Math.round(this.y*r)/r+"]"}negative(){return this.x=-this.x,this.y=-this.y,this}add(t){return t instanceof Vector2D?(this.x+=t.x,this.y+=t.y):(this.x+=t,this.y+=t),this}subtract(t){return t instanceof Vector2D?(this.x-=t.x,this.y-=t.y):(this.x-=t,this.y-=t),this}multiply(t){return t instanceof Vector2D?(this.x*=t.x,this.y*=t.y):(this.x*=t,this.y*=t),this}divide(t){return t instanceof Vector2D?(0!=t.x&&(this.x/=t.x),0!=t.y&&(this.y/=t.y)):0!=t&&(this.x/=t,this.y/=t),this}equals(t){return this.x==t.x&&this.y==t.y}dot(t){return this.x*t.x+this.y*t.y}cross(t){return this.x*t.y-this.y*t.x}length(){return Math.sqrt(this.dot(this))}normalize(){return this.divide(this.length())}min(){return Math.min(this.x,this.y)}max(){return Math.max(this.x,this.y)}toAngles(){return-Math.atan2(-this.y,this.x)}angleTo(t){return Math.acos(this.dot(t)/(this.length()*t.length()))}toArray(t){return[this.x,this.y].slice(0,t||2)}clone(){return new Vector2D(this.x,this.y)}set(t,r){return this.x=t,this.y=r,this}}Vector2D.negative=function(t){return new Vector2D(-t.x,-t.y)},Vector2D.add=function(t,r){return r instanceof Vector2D?new Vector2D(t.x+r.x,t.y+r.y):new Vector2D(t.x+r,t.y+r)},Vector2D.subtract=function(t,r){return r instanceof Vector2D?new Vector2D(t.x-r.x,t.y-r.y):new Vector2D(t.x-r,t.y-r)},Vector2D.multiply=function(t,r){return r instanceof Vector2D?new Vector2D(t.x*r.x,t.y*r.y):new Vector2D(t.x*r,t.y*r)},Vector2D.divide=function(t,r){return r instanceof Vector2D?new Vector2D(t.x/r.x,t.y/r.y):new Vector2D(t.x/r,t.y/r)},Vector2D.equals=function(t,r){return t.x==r.x&&t.y==r.y},Vector2D.dot=function(t,r){return t.x*r.x+t.y*r.y},Vector2D.cross=function(t,r){return t.x*r.y-t.y*r.x};